import React, { Component } from 'react';
import './App.css';
import Button from './Button';
import Panel from './panel';

class App extends Component {

  constructor(props) {
    super(props);

    this.state = {
      name: "Welt"
    }


  setTimeout(() => {
    this.setState({
      name: "Venus"
    })
  }, 3000);
}



  render() {
    return (
      <div className="App">
        <h2>Hallo {this.state.name}</h2>
      </div>
    );
  }
}

export default App;
